window.bookSummaryJSON = "<p><b>2022 MYSTERY AUDIE AWARD WINNER!</b></p> <p><b>A BRAND-NEW NOVEL FROM LEGENDARY STORYTELLER STEPHEN KING!</b></p> <p><b>SOMETIMES GROWING UP MEANS FACING YOUR DEMONS.</b></p> <p>The son of a struggling single mother, Jamie Conklin just wants an ordinary childhood. But Jamie is no ordinary child. Born with an unnatural ability his mom urges him to keep secret, Jamie can see what no one else can see and learn what no one else can learn. But the cost of using this ability is higher than Jamie can imagine—as he discovers when an NYPD detective draws him into the pursuit of a killer who has threatened to strike from beyond the grave.</p> <p><i>Later</i> is Stephen King at his finest, a terrifying and touching story of innocence lost and the trials that test our sense of right and wrong. With echoes of King’s classic novel, <i>It</i>, <i>Later</i> is a powerful, haunting, unforgettable exploration of what it takes to stand up to evil in all the faces it wears.</p>"; 
